webpackJsonp([45554485860321],{5424:function(e,t){e.exports={data:{post:{html:"<p>Last evening we had an interesting choice of movies on TV: Roland Emmerich's Independence Day on Pro7, Wolfgang Petersen's Air Force One on RTL. With attacks on New York, the White House and the President, I'm not sure how either one would play on US TV at the moment.<br />\nHaving already seen Will Smith do his thang with the aliens, we went with Harrison Ford on the plane. Independence Day would have been more fun :-)</p>",fields:{title:"Duel of the German Directors",date:"14 Jan 2002",url:"https://papascott.de/2002-01-14-duel-of-the-german-directors/"}}},pathContext:{slug:"/2002-01-14-duel-of-the-german-directors/",prev:{fields:{title:"Brother Can You Do Some Time?",date:"14 Jan 2002",slug:"/2002-01-14-brother-can-you-do-some-time/"}},next:{fields:{title:"No More Of This",date:"14 Jan 2002",slug:"/2002-01-14-no-more-of-this/"}}}}}});
